import React from 'react';
import Button from '@mui/material/Button';
import ImageGrid from './ImageGrid';

function Get_Started() {
    return (
        <main style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', height: '90vh', paddingLeft: '50px', paddingRight: '50px' }}>
            <div style={{ flex: '0 0 40%', textAlign: 'right' }}> {/* Text container */}
                <div style={{ fontSize: '3rem', fontFamily: 'Montserrat, sans-serif', fontWeight: 'bold' }}>ArtisticAlly</div>
                <div style={{ fontSize: '1.5rem', fontFamily: 'Montserrat, sans-serif' }}>A platform to connect artists and performers to events, job opportunities and community!</div>
            </div>
            <ImageGrid style={{ flex: '1', marginLeft: '20px' }} /> {/* Image grid */}
            <Button
                variant="contained"
                style={{
                    fontSize: '4rem',
                    background: 'linear-gradient(45deg, #9C27B0 30%, #2196F3 90%)', // Purple to blue gradient
                    color: '#fff',
                    borderRadius: '50px',
                    textTransform: 'capitalize',
                    fontFamily: 'Montserrat, sans-serif',
                }}
            >
                Welcome!
            </Button>
        </main>
    );
}

export default Get_Started;
